import logo from './logo.svg';
import './App.css';

function App() {

  const atividades = [

    {
      id: 1,
      description: "Estudar"
    },
    {
      id: 2,
      description: "Malhar"
    },
  ];

  return (
    <div className='mt-3'>
      <ul className="list-group">
        {atividades.map(atividade => (
          <li key={atividade.id} className="list-group-item"></li>
        ))}

      </ul>
    </div>
  );
}

export default App;
